import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import reportWebVitals from './reportWebVitals';

$.getJSON('https://kontests.net/api/v1/all', function(data) {
  var text = "";    
  for(var info in data)
  {
      if(data[info].status == "BEFORE")
      {
          text = text + data[info].name + " " + "<br>";
      }
  }
console.log(text);
});

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
